import Register from '../../../../assets/images/Register.svg';
import Invest from '../../../../assets/images/Invest.svg';
import Track from '../../../../assets/images/Track.svg';

export const walkThroughInfo = [
  {
    background: 'white',
    number: 1,
    title: 'Register Now',
    text: 'All you need is your name and your email to get started. From here, you can browse our list of tokenized properties',
    image: Register,
  },
  {
    background: 'grey',
    number: 2,
    title: 'Invest',
    text: 'Buy and trade property tokens to build your portfolio',
    image: Invest,
  },
  {
    background: 'white',
    number: 3,
    title: 'Track',
    text: 'Watch your money grow and manage your portfolio in a simple, intuitive way—anywhere, anytime',
    image: Track,
  },
];
